import React from 'react';
import ReactDOM from 'react-dom/client';
import './style.css';
import { Navbar, Posts, Profile  } from './components';
const App = () => {
    return (
        <div>
        <Navbar />
        <Posts />
        <Profile />
        </div>
    )
}

const container = document.querySelector('#container');
const root = ReactDOM.createRoot(container);
root.render(<App />);

